function Option() {
    //Create image and option list
    const imgList = []
    const optionList = ['Planning','Retro','Daily Standup','Creat Story']

    //Rendered the homepage list item
    const renderedItmes = optionList.map((item, index) => (
        <div>
            <img></img>
            <div>
                <text key={index}>item</text>
            </div>
        </div>
    ));

    return(
        <section>

            <div>
                <text></text>
            </div>
        </section>
    );
}

export default function Options() {
    return (
        <section>
            <h1>AGILE TOOL</h1>
            <Option />
        </section>
    );
}
